import React from "react";
import { Hr, Title, Wrap } from "./styled";

interface Props {
  imgUrl: string;
  title: string;
  description: string;
  address: string;
}

export default function Company(props: Props) {
  return (
    <Wrap>
      <Title>{props.title}</Title>
      <Hr />
      <Img $backgroundImg={props.imgUrl} />
    </Wrap>
  );
}
